import React, { useState } from "react";
import { useEffect } from "react";

const HostVans = () => {
  const [hostVans, SetHostVans] = useState([]);
  useEffect(() => {
    fetch("/api/host/vans")
      .then((res) => res.json())
      .then((data) => SetHostVans(data.vans));
  }, []);
  const HostVansElements = hostVans.map((item) => {
    return (
      <div className="host_vans_item">
        <h1>{item.title}</h1>
      </div>
    );
  });
  return <div className="host_vans_list">{HostVansElements}</div>;
};

export default HostVans;
